import React from 'react'
import loadingAnimation from './loading.gif'

export default function Loading() {
  const loadingStyle = {
    width:'100%',
    display:'flex',
    justifyContent:'center',
    alignItem:'center',

  }
  return (
    <div style={loadingStyle}>
        <img src={loadingAnimation} width='100%'/>
    </div>
  )
}
